DROP TABLE IF EXISTS `users`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `users` (
  `s_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `id` int DEFAULT NULL,
  `account` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL,
  `name` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT NULL,
  `token` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT NULL,
  `platform` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '渠道标识',
  `sex` tinyint DEFAULT NULL,
  `mac` varchar(64) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '快速登录的账号',
  `nickname` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT NULL,
  `c_code` varchar(16) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '国家代码',
  `phone` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT NULL,
  `register_time` int DEFAULT NULL,
  `password` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '密码(游客米有MD5)',
  `agent` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT '0' COMMENT '代理标识',
  `status` tinyint DEFAULT '0' COMMENT '用户状态0正常1冻结',
  `register_ip` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '注册ip',
  `grandfather_id` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '上上级',
  `total_direct_num` int unsigned NOT NULL DEFAULT '0' COMMENT '直属下级成员',
  `total_other_num` int unsigned NOT NULL DEFAULT '0' COMMENT '其他成员(下级的直属成员)',
  `zalo_id` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT '' COMMENT 'zalo_id',
  `facebook_id` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT '' COMMENT 'facebook_id',
  `google_id` varchar(128) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT '' COMMENT 'google_id',
  `organic` tinyint unsigned NOT NULL DEFAULT '2' COMMENT '自然属性(1 广告 2 自然)',
  `token_time` int DEFAULT '0' COMMENT 'token有效时间',
  `device_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '设备ID登陆',
  `invitation_code` varchar(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '邀请码',
  `register_device_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '注册的设备ID',
  `father_id` varchar(32) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '上级',
  `path` varchar(2048) CHARACTER SET utf8mb3 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '关系链',
  `agent_type` tinyint unsigned DEFAULT '1' COMMENT '代理模式:1三级代理2金字塔',
  `total_brokerage` bigint unsigned NOT NULL DEFAULT '0' COMMENT '总佣金',
  `total_extract_brokerage` bigint unsigned NOT NULL DEFAULT '0' COMMENT '总提取佣金',
  PRIMARY KEY (`s_id`),
  KEY `id` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8_unicode_ci;
